//--------------------------------------------------------------------------------------//
//                                         Home                                         //
//--------------------------------------------------------------------------------------//

import React, { useState } from 'react';
import './Home.css';
import '../normalize.css';


function Home() {
    // Aliases array
    const aliases = [
        "Computer Science Student",
        "Aspiring Web Developer",
        "Enthusiastic Programmer",
        // Add more aliases as needed
    ];

    // State to keep track of current alias
    const [currentAlias, setCurrentAlias] = useState(aliases[0]);

    // Effect hook to change alias every few seconds
    useEffect(() => {
        const intervalId = setInterval(() => {
            setCurrentAlias(prevAlias => {
                const index = (aliases.indexOf(prevAlias) + 1) % aliases.length;
                return aliases[index];
            });
        }, 3000); // Change every 3000 milliseconds (3 seconds)

        // Clear interval on component unmount
        return () => clearInterval(intervalId);
    }, []);
    return (
        <div className = "home " id = "home">
            <div className="home__left">
                <div className="home__text-container">
                    <h1 className = "home__text-name">Kevin
                    Cendana</h1>
                    <p className = "home__text-alias">Computer Science Student</p>
                </div>
            </div>
            <div className="home__right">
                <div className="home-image-container"> </div>
            </div>
        </div>
    );
}

export default Home;
